import './shop.css'

function Shop (){
    return(
        <div className="dropmenu"> 
            <p className="a">All Products</p>
            <hr/>     
            <p className="a">Popular Products</p>
            <p className="a">New Arrivals</p>
        </div>
    )
}
export default Shop;
